const BlogList = ({ blogs, title, deleteHandle }) => {
  //or const BlogList = (blogs,title)

  return (
    <div className="blog-list">
      <h1>{title}</h1>
      {blogs.map((blog) => (
        <div className="blog-preview" key={blog.id}>
          <h2>{blog.title}</h2>
          <p>Written by {blog.author}</p>
          <button
            onClick={() => {
              deleteHandle(blog.id);
            }}
          >
            Delete blog
          </button>
        </div>
      ))}
    </div>
  );
};

export default BlogList;
